import React from 'react';
import { useSelector } from 'react-redux'

export default function Cart(state) {
  const orders = useSelector((state)=>state.orders)
  return (
    <div className='cart-item'>
      {orders.map((order) =>(
        <OrderItem title = {order.title} />
      ))}
    </div>
  )
}
